import React from 'react';
import FriendCard from './FriendCard';

const FriendsList = ({friendsList}) =>
{
  const friends = friendsList ? friendsList.map(username => (
    <p>
      <FriendCard friend={username}/>
    </p>
  )) : null;

  return (
    <div>
      {friends}
    </div>
  );
}

export default FriendsList;
